using System.Data;

public class ComputersAndBatteries
{
    public class SortedBag<T>
    {
        private readonly SortedDictionary<T, int> _dict = new SortedDictionary<T, int>();
        public SortedBag(IEnumerable<T> values)
        {
            foreach (var value in values)
            {
                Add(value);
            }
        }

        public void Add(T value)
        {
            if (_dict.TryGetValue(value, out int count))
            {
                _dict[value] = count + 1;
            }
            else
            {
                _dict.Add(value, 1);
            }
        }

        public T Min => _dict.Keys.Min();
    }

    public long MaxRunTime(int computers, int[] batteries)
    {
        if (computers == 0 || batteries.Length < computers) return 0;
    }

    [Fact]
    public void NoComputers()
    {
        Assert.Equal(0, MaxRunTime(0, new int[] { 1, 2, 3 }));
    }

    [Fact]
    public void NotEnoughBatteries()
    {
        Assert.Equal(0, MaxRunTime(3, new int[] { 1, 2 }));
    }

    [Fact]
    public void LowestIsOne()
    {
        Assert.Equal(1, MaxRunTime(3, new int[] { 1, 2, 3 }));
    }

    [Fact]
    public void LowestIsMoreThanOne()
    {
        Assert.Equal(2, MaxRunTime(3, new int[] { 2, 3, 4 }));
    }

    [Fact]
    public void MoreBatteriesThanComputers()
    {
        Assert.Equal(3, MaxRunTime(3, new int[] { 1, 2, 3, 4 }));
    }

    [Fact]
    public void PaulosVector()
    {
        Assert.Equal(1, MaxRunTime(3, new int[] { 1, 1, 7 }));
    }

    [Fact]
    public void LeetcodeVector2()
    {
        Assert.Equal(4, MaxRunTime(2, new int[] { 3, 3, 3 }));
    }

    [Fact]
    public void LeetcodeVector12()
    {
        Assert.Equal(41, MaxRunTime(12, new int[] { 11, 89, 16, 32, 70, 67, 35, 35, 31, 24, 41, 29, 6, 53, 78, 83 }));
    }

